import React from 'react';
import "./Login.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import icon from '../image/icon.png';
export default function Login() {
  return (
    
    <>
    <div className='overlayer'></div>
    <div className='containier'>
      <img src={icon} alt="" />
      <form action="" method='post'>
        <input type="text" name="name" id="name" placeholder='Enter Your Name...' class=" my-4"/>
        <input type="text" name="email" id="email" placeholder='Enter Your Email...' class=" form-control my-4"/>
        <input type="text" name="password" id="password" placeholder='Enter Your Password...' class=" form-control my-4"/>
        <div className='login'>
          <button type='submit'>login</button>
          <a href="www" id='alert'>عارف انك نسيت كلمه السر؟</a>
        </div>
      </form>
    </div>
    </>
    
  );
}
